import React, { Component, PropTypes } from 'react';

export default class Task extends Component {
	render() {
		return (
			<div><span>"HEY"</span>
			<li>{this.props.task.text}</li></div>
		);
	}
}

Task.PropTypes = {
	task: PropTypes.object.isRequired
}
